var tipuesearch = {"pages": [{'title': 'About', 'text': 'group 4 Repository: \xa0 40423155 \xa0 | Site: \xa0 40423155 Repository: \xa0 40723101 \xa0 | Site: \xa0 40723101 Repository: \xa0 40723102 \xa0 | Site: \xa0 40723102 Repository: \xa0 40723106 \xa0 | Site: \xa0 40723106 Repository: \xa0 40723111 \xa0 | Site: \xa0 40723111 Repository: \xa0 40723119 \xa0 | Site: \xa0 40723119 Repository: \xa0 40723121 \xa0 | Site: \xa0 40723121 Repository: \xa0 40723124 \xa0 | Site: \xa0 40723124 Repository: \xa0 40723134 \xa0 | Site: \xa0 40723134 Repository: \xa0 40723135 \xa0 | Site: \xa0 40723135 Repository: \xa0 40723136 \xa0 | Site: \xa0 40723136 Repository: \xa0 40723138 \xa0 | Site: \xa0 40723138 \xa0 (group leader) \n 分組倉儲: https://github.com/s40723138/cd2020ag4 \n 分組網站: https://s40723138.github.io/cd2020ag4/content/index.html', 'tags': '', 'url': 'About.html'}, {'title': 'week', 'text': '每周進度', 'tags': '', 'url': 'week.html'}, {'title': 'week1', 'text': '創建新倉儲 cd2020 \n 步驟: \n \n 登入自己 gihub \xa0建立新的 倉儲 cd2020 \n 接著執行git clone  https://github.com/s40723102/cd2020.git \xa0(自己的網址) \n 執行git submodule add\xa0 https://github.com/mdecourse/cmsimde.git \xa0取得子模組資料 \n 將cmsimde>up_dir裡的所有項目全部複製到外面資料夾cd2020中 \n 接著就能執行python wsgi.py編輯靜態網站 \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': '更新可攜裝置中的Python的版本更新至3.8.2 \n 1.到Python的官方網站 https://www.python.org/downloads/windows/ \n 2.把 Windows x86-64 executable installer 安裝至自己可攜系統 \n \n 把pip的選項去掉 \n \n 3.選擇路徑將python安裝至可攜式系統中的Y槽 \n 4.開啟start_mdecourse.bat批次檔 \n 5.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n 6.將安裝的版本資料夾取名為py382 \n 7.執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 8..執行get-pip.py(取得安裝管理工具) \n \n 9.執行pip install指令 \n 將 \n pip install\xa0Flask \n pip install\xa0Markdown \n pip install\xa0lxml \n pip install\xa0bs4 \n pip install\xa0flask_cors \n pip install\xa0pelican \n pip install\xa0leo \n 將這些3.8.2版本缺少的模組依序安裝下來 \n \n 10.完成 \n 參考組員: https://s40723111.github.io/cd2020/content/index.html', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '四輪機器人 \n CoppeliaSim簡介 \n 具有集成開發環境的機器人模擬器CoppeliaSim基於分佈式控制體系結構：可以通過嵌入式腳本，插件，ROS節點，BlueZero節點，遠程API客戶端或自定義解決方案分別控制每個對象/模型。這使CoppeliaSim非常通用，非常適合多機器人應用。控制器可以用C / C ++，Python，Java，Lua，Matlab，Octave或Urbi編寫。 \n CoppeliaSim應用程序列表 \n 1.工廠自動化系統仿真 \n 2.遠程監控 \n 3.硬件控制 \n 4.快速原型製作和驗證 \n 5.安全監控 \n 6.快速算法開發 \n 7.機器人相關教育 \n 產品介紹 \n CoppeliaSim可以用作獨立應用程序，也可以輕鬆地嵌入到主客戶端應用程序中：它的佔用空間小且精心設計的API使CoppeliaSim成為嵌入更高級別應用程序的理想選擇。集成的Lua腳本解釋器使CoppeliaSim成為了一種極其通用的應用程序，使用戶可以自由組合低級/高級功能以獲得新的高級功能。 \n 應用程式介面的機器人模擬軟體:\xa0 \n \n 跨平台支援(Windows, MacOSX, Linux) \n 支援六種撰寫程式的方式 (嵌入式腳本、插件、附加組件、ROS節點、遠端客戶端應用程式介面、BlueZero節點) \n 支援6種程式語言 (CC++、Python、Java、Lua、Matlab、和Octave) \n 400種以上的應用程式介面函數 \n 支援4種物理引擎 (ODE, Bullet, Vortex, Newton) \n 整合ray-tracer (POV-Ray) \n 具備完整的運動學計算器 (支援任何機構的正運動學與逆運動學計算) \n 網格-網格干涉偵測 (meshes, OC trees and point clouds) \n 網格-網格最短距離計算 (meshes, OC trees and point clouds) \n 支援路線及運動完整規劃 (支援二~六維的完整約束,車輛類型載具的非完整約束,以及對於連鎖運動的規劃) \n 內建影像處理的視覺感測器 (完全可擴充) \n 真實的接近感測器 (偵測範圍內的最短距離計算) \n 內建含編輯器的客製化使用者介面 \n 完全整合第四類Reflexxes Motion Library以及RRS-1 介面規格 \n 支援資料的儲存與視覺化 (time graphs, XY graph or 3D curves) \n 整合形狀編輯模式 \n 支援噴水與氣體噴射的動態顆粒模擬 \n 支援拖放功能的模型瀏覽器 (模擬計算中仍可使用) \n 支援多重的取消重做、影像錄製、油漆噴塗、建立詳盡的文檔等功能 \n \n', 'tags': '', 'url': 'week4.html'}, {'title': '心得', 'text': '40723102 心得 \n 大約看過這本電子書覺得難度很深，需要花更多時間來了解 \n', 'tags': '', 'url': '心得.html'}, {'title': 'week6', 'text': 'OBS操作 \n 1.先至官網下載可攜式OBS軟體並開啟畫面 \n \n 2.點選圖下畫面中加號符號 \n 顯示器擷取(個人螢幕畫面) \n 視訊擷取裝置(拍到自拍個人頭像) \n \n Youtube部分 \n 1.點選直播圖示 \n \n 2.設定資訊(建議不公開) \n \n 3.設定金鑰 \n \n 4.複製到OBS端並將 平台更改為Youtube \n \n 5. 點選開始串流 就可以連接至youtube端 \n \n', 'tags': '', 'url': 'week6.html'}, {'title': 'week7', 'text': '40723102學員抽點直播 \n 第四組 抽點 \n 40723138 \n 40723102 \n 40723136 \n 40723135 \n 小問題: 第一次直播個人頭像並未調好 \n 第', 'tags': '', 'url': 'week7.html'}, {'title': 'week8', 'text': '40723102學員 幸運到不行 抽點直播 \n 第四組抽點 \n 40723102 \n 40723101 \n 40723119 \n 40723138 \n 小問題: 改善上週擋住時間的小頭像 \n \n', 'tags': '', 'url': 'week8.html'}, {'title': 'week10', 'text': '嘗試使用ohshape繪製車殼，由於沒有接觸過立體繪圖，所以請同學指導我，導致進度有點落後 \n', 'tags': '', 'url': 'week10.html'}, {'title': 'week11', 'text': '繪製車框 \n https://cad.onshape.com/documents/4ef89cf7cd79611d391b6501/w/749b4f8a14e83b13dc5a7c52/e/ece1fdcd3b797f692130fe41 \n \n \n \n 由於是第一次觸碰立體繪圖，車體看起來有點簡易', 'tags': '', 'url': 'week11.html'}, {'title': 'week12', 'text': '1.開啟 \n \n 2.勾選後點擊import \n \n 3.即可進入此畫面 \n', 'tags': '', 'url': 'week12.html'}, {'title': 'week13', 'text': '\n 照著步驟逐步完成 \n IPV4 \n \n IPV6 \n \n 嘗試打開近端發生問題 \n \n 第14周更新(後來嘗試後成功開啟) \n \n \n \n \n \n \n', 'tags': '', 'url': 'week13.html'}, {'title': 'week14', 'text': '開啟虛擬主機遠端的操作步驟: \n 變更IPv6網路介面卡設定 \n 依照老師給的格式去設定 https://github.com/mdecourse/cd2020/blob/master/downloads/w13_ipv6_assignment.txt \n 點選IPV6 \n \n 2020 為年份 1 為 cda，71 為 407231 表示甲班，\xa002則為該班學號 \n \n 更新後可成功開啟 \n', 'tags': '', 'url': 'week14.html'}, {'title': '直播記錄', 'text': 'cd2020ag4 \n 第一次會議紀錄W2 \n \n 第二次會議紀錄W4 \n \n 第三次會議紀錄\xa0W6 \n \n 第四次會議紀錄\xa0W7 \n', 'tags': '', 'url': '直播記錄.html'}, {'title': '0415抽點直播', 'text': '40723102學員抽點直播 \n 第四組 抽點 \n 40723138 \n 40723102 \n 40723136 \n 40723135 \n 小問題: 第一次直播個人頭像並未調好 \n 第 \n', 'tags': '', 'url': '0415抽點直播.html'}, {'title': '0422抽點直播', 'text': '40723102學員幸運到不行抽點直播 \n 第四組抽點 \n 40723102 \n 40723101 \n 40723119 \n 40723138 \n 小問題: 改善上週擋住時間的小頭像 \n', 'tags': '', 'url': '0422抽點直播.html'}, {'title': '問題', 'text': '遇到小組倉儲輸入指令(python wsgi.py)時，產生錯誤無法作動 \n 解決辦法 \n 輸入 \n 1-git submodule init \n 2-git submodule update \n \n 即可開啟。 \n \n 此為參考同學 40723103 的倉儲中problem 1 \n', 'tags': '', 'url': '問題.html'}]};